import React from "react";
import { Link } from "react-router-dom";
const Menu = () => {
  return (
    <div className="ui three cards">
      <Link
        onClick={() => {
          console.log("deneme");
        }}
        className="ui red fluid card"
      >
        <div className="content">
          <div className="header">New Mail</div>
        </div>
      </Link>
      <Link className="ui orange fluid card">
        <div className="content">
          <div className="header">Load Default templates</div>
        </div>
      </Link>
      <Link to="/templates/new" className="ui yellow fluid card">
        <div className="content">
          <div className="header">Create New Template</div>
        </div>
      </Link>
    </div>
  );
};

export default Menu;
